import React, { useState } from 'react';
import axios from 'axios';
import { Input, Button } from 'react-bootstrap';

function PatientOperations() {
  const [formData, setFormData] = useState({
    email: '',
    message: ''
  });

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8080/api/patients/add-query', formData);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prevState => ({ ...prevState, [name]: value }));
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="email">Email</label>
        <Input type="email" name="email" id="email" placeholder="name@example.com" onChange={handleChange} />
      </div>

      <div className="form-group">
        <label htmlFor="message">Message</label>
        <textarea className="form-control" name="message" id="message" rows="3" onChange={handleChange}></textarea>
      </div>

      <Button type="submit">Submit</Button>
    </form>
  );
}

export default PatientOperations;
